import React, { useEffect, useState } from "react";
import Table from "./components/table";

function App() {
  const [clients, setClients] = useState([
    { nome: "", documento: "", sexo: "", id: "" },
  ]);
  return (
    <div className="App">
      <Table clients={clients} setClients={setClients} />
    </div>
  );
}

export default App;
